                "User Comments": "The paper denounces the Nazi campaign of extermination. \n\nNote: In the previous Issue, December 18, there is an article on page 2 detailing anti-Christian Nazi sentiments, with no mention of Jews.\n\n[Community Manager note: This editorial can also be found digitized via the Arizona Memory Project here: https://azmemory.azlibrary.gov/digital/collection/elsol/id/5719/rec/85]",
