                "Status": "Published",
                "Contributor": "Micah Mallory Mallory",
                "User Comments": "What I found extremely remarkable about this piece in particular was the amount of detail the paper decided to share about the way the Nazi's priced Jewish corpses and what percentage of Jewish ancestry a person needed to be persecuted.  The population of Idaho in 1942 wasnt even half a million.  The number is even smaller for those who actually were able to pick up the newspaper and read it.  The fact this article went into such specifics for a comparably small audience is very fascinating.",
                "CM Comments": "Hello Micah, thank you for your contribution to History Unfolded, you found great articles! Here it looks like you merged two articles in one: \"Nazi Grip on Stalingrad Weakens Under Crushing Russian Drive\" (last column) and \"Hitler Marks Jews For Death\" are two different stories. Only the latter is relevant to the collection in general and to our \"Nazi Plan To Kill All Jews Confirmed\" event module in particular. It's a bit tricky but you can determine that by looking at the horizontal lines that separate each piece. \nIt turns out we already have this article in the database, but maybe you didn't see that because of that confusion. In general, remember to check the database at https://newspapers.ushmm.org/search/ before submitting. Let us know if you have questions. I'll send some more feedback separately. Great work! \u2013Nadia",
