                "User Comments": "This article is relevant because it shows how the world now knows about the murders and atrocities of the Nazis of the Holocaust.\n\nFull Article URl: https://www.newspapers.com/image/220012233/?terms=%22%C2%A8Nazi%C2%A8%20%C2%A8Jews%C2%A8&match=1",
                "CM Comments": "Philip, this is a great new edition for the History Unfolded database. On the one hand, there is clearly a relevant article about the first public reports on the Final Solution. On the other hand, the article is on page 5. It's interesting for me to ponder to what extent Americans would have read an article on page 5, and also how the level of prominence of reporting in different newspapers across the country may have shaped reactions. Thank you for your work! -Eric",
