                "Contributor": "Grace Sainsbury",
                "User Comments": "It's interesting that a small rural town that's mostly Christian put this story on the first page. Granted, it is at the bottom, but it is still there. It's also the first time Americans would have heard about a specific plan to murder Jews rather than assuming massacres were isolated pogroms or simply war crimes.",
                "CM Comments": "Grace, the observation you made in your \"1,715,000 Jews Are Said Slain\" article is valid here as well. Reporters weren't too sure of the facts, or maybe meant to leave some part of doubt: \"The story \u2014 *reportedly* confirmed by the State Department . . . . [Dr. Wise] *said* he carried official documentary proof . . . .\".  \nYour Daily Messenger article on the Oswego refugee camp is an excellent new addition to the database as well, it's been approved. Great work, Grace! \u2013Nadia",
