                "CM Comments": "Letters to the editor give a fascinating insight into both knowledge of news and reactions. In this particular case, it's not 100% clear to me that the letter writer Frank Ferris is writing directly in response to news about the Final Solution, as there were reports of the Nazis attempting to exterminate Jews even before November 1942. However, the timing would make it logical, so I will approve this. Great find, Elise! -Eric",
