                "CM Comments": "https://www.newspapers.com/image/528428423/\n\n__________\nHello Kari, thank you for this first batch of submissions from the Helena Independent! Your articles on Kristallnacht and on the Boycott have been approved to the public end of the database. \nRegarding the 3 \"No coverage\" submissions to the Nazi Plan to Kill All Jews\" event module, you entered the year 1938 (November 24-26). The year for this event is actually 1942; I don't see an entry for Nov 24, 1938 in Newspapers.com, so I'm assuming this is just a typo! Can you please confirm? I did some research and didn't find anything either.      \nClipping in Newspapers.com is a bit tricky, I've added the links for you, thank you for submitting  the images.   \nI hope you'll have time to pursue research. Eric says we would love to try to coordinate a Sprint with you in the spring; would you reach out to him around mid-November if he hasn't contacted you by then? Thank you! \u2013Nadia",
