                "CM Comments": "Hi Colette,\n\nAmazing work! All 7 of your articles from Thursday, April 23 have been approved. Thank you for all your hard work!\n\nI have edited all your submissions to match how one of us reviewers would fill out a submission form and how the image of the article should look. Please use these as examples for your future article submissions.\n\nTwo of your submissions we already had in the database. We love to get knew ones if you can find them! See what we already have in the database by using this link: https://newspapers.ushmm.org/blog/2017/09/14/how-do-i-upload-articles-not-yet-in-the-database\n\nThank you for the 5 new articles you have added to the database. Excited to see what new articles you will find in the future!\n\n- Samantha",
