                "Publication Date": "Sunday, March 7, 1943",
                "Page": "E8",
                "Headline": "While We Do Nothing",
                "Sub Headline": "Nazis Proceed With the Ruthless Extermination of Victims",
                "Byline": "Dorothy Moulton Mayer",
                "Event": "Nazi Plan to Kill All Jews Confirmed",
                "Location of research": "ProQuest Historical Newspapers (www.proquest.com)",
                "Status": "Published",
                "Contributor": "Elvia Verdugo",
                "User Comments": "I am not sure if this article belongs in the \"We Will Never Die\" category; however, it is an interesting opinion piece showing how much Americans were capable of knowing about the Holocaust while it was happening. The writer, Dorothy Moulton Mayer, was extremely well-informed about the atrocities happening in Europe and sounded passionate throughout her letter. The writer also had an exciting life, as she was a singer in Austria in the 1920s, the subject of photography, and she later became a historian of famous women. I found this piece intriguing, and I hope you do too.",
                "CM Comments": "This is a wonderful find Elvia! I did refile it under \"Nazi Plan  to Kill All Jews Confirmed\" event module just because it was more relevant to that module. Again, this is a wonderful article! -Megan S.",
