                "Status": "Published",
                "Contributor": "Emily Harkins",
                "User Comments": "This snippet is very hard to find inside this newspaper. It falls midway on page 12 out of 30. It is confusing who exactly is the author of this mention. I suspect the column is by Joseph Fort Newton but again, there is no specifics on who is the author. \n\nThe small size of this article is appalling and one would think that Rabbi Wise's alert about the impending severity of the Holocaust would have been given front page status for this newspaper.",
                "CM Comments": "Great find, Emily! Please note, you're right that there is no clear author to the column, which is not unusual. In this case, we just leave the Author/Byline field blank. \nAnd I agree that summing up this chilling piece of news in less than 4 lines and sticking it between a call for bipartisanship and gasoline rationing feels wrong. \nLooking forward to other interesting finds from you! \u2013Nadia",
