                "Status": "Published",
                "Contributor": "Emily Schalliol",
                "User Comments": "",
                "CM Comments": "Emily, this is a fascinating piece! The writer seems to not have a deep or accurate understanding of the fact that many Jews tried (and failed) to come to the US before this time, due in part to US immigration law restrictions/hurdles. There is a follow-up piece in the same paper (https://newspapers.ushmm.org/article/20441) that you should read if you haven't already. The writer (perhaps the same one) makes similar arguments. We did not have this piece that you just submitted, though. It is a great addition to the database! I was also able to include the newspapers.com clipping you did in the entry, so others can read this easier in the future. Thank you for your work! -Eric",
