                "Contributor": "Jonathan Przelenski",
                "User Comments": "This article is important because it details the murders of Jews to the American public, and in this case the city of Tampa, in 1942, well before the discovery of the concentration camps. However, this article is on page 4 of the newspaper and reserved to a small sliver of the whole newspaper. The article is located by a Ringling Circus Elephant Trainer death, and not front page news. \n\nTo find this article, I typed in the keyword Stephen Wise under Newspapers.com and narrowed my search to the dates provided on History Unfolded.",
                "CM Comments": "Hello Jonathan, thank you for your contribution to History Unfolded! \nYour article has been approved. Please note, you're right to point out the article was positioned far from the front page, but its title is actually prominently displayed on p.4: \"State Department Believed to Have Proof of Murders\" is the sub-headline; the main headline is in bigger characters above that : \"U. S. Jewish Group Hears Details of Polish Slaughter Today\" \u2013 I edited your data for you (the circus elephant photo right next to it is indeed awkward!) \nGood job adding the author, I also added the news service he was working with, mentioned at the beginning of the paragraph: Kenneth L. Dixon (AP). Keep up the great work, we look forward to other interesting finds from you. \u2013Nadia",
