                "Contributor": "Camric Hamann",
                "User Comments": "This article shows that facts about the Holocaust were hidden in hard-to-find corners of newspapers, which would make it hard for anyone to learn anything about it.\n\nThe relevant section is under \"BRIEFS: ROUNDUP\". \n\nLink to article: http://mapleton.advantage-preservation.com/viewer/?i=f&by=1942&bdd=1940&bm=12&bd=10&d=12101942-12101942&fn=scan_19421105_19450322_0032&df=1&dt=10",
                "CM Comments": "While this article does not make it clear that the Nazis had a plan to exterminate all the Jews as part of the \"Final Solution\", the mention of \"a program to kill off 50 per cent of all Jews\" by 1943 is related. As a result, I am going to mark this approved. I agree with you that many readers may not have seen or read that section of the paper. It brings up an interesting point that it seems in some cases, information about the Holocaust was available at the time, at least in part, but did Americans see, read, understand, and respond to it? Good work, Camric! -Eric",
