                "Location of research": "Carroll University Newspaper Archive (http://archives.carrollu.edu/)",
                "Status": "Published",
                "Contributor": "Clara Clifford",
                "User Comments": "This article is relevant to the event: Nazi Plan to Kill All Jews Confirmed. The article details the heinous and gruesome tactics that Nazis in Germany were utilizing to exterminate the Jews. Although the United States had their suspicions about what Nazi Germany was doing overseas, nothing was confirmed until Stephen Wise held a press conference. During this press conference, held on November 24th, 1942,  he detailed that an estimated 2,000,000 Jews had been murdered as a part of Hitler's campaign for lebenstraum. This information opened the eyes of Americans to the severity of what was occurring overseas in Europe.",
                "CM Comments": "Clara, your summary actually addresses two very closely related but technically two separate articles. I adjusted the sub-headline and byline in your entry to reflect the first of the two articles. Good summary! -Eric",
