                "User Comments": "This article appears to provide a straightforward and unfiltered account of the tortures Jewish people were subjected to in concentration camps in Poland as well as Nazi plans to \"wipe out\" a large portion of Jews. The article itself was also surrounded by other articles regarding military/war progressions happening outside the United States; those who read the front page of the Carbondale Free Press newspaper would become vividly aware of the brutality that was pushed on Jewish people overseas under Hitler's rule.",
