                "CM Comments": "Jacob,\nThank you for your submission to History Unfolded. This was a great find! In the future, just be careful when you are entering the date. I have corrected this information for you. Also, UP is the byline, so I have added that as well. But overall, great job! I hope you will submit more to History Unfolded in the future. -Katie",
