                "User Comments": "What's shocking is how hidden away it is. Minor local political news (\"Laramie to Go Ahead with Manager Government Plans) received a much more prominent headline and location on the front page.",
                "CM Comments": "Matt,\n\nIt is definitely interesting to see. Of course, it raises the question of whether it is more prominent to be on bottom of the front page or top of the second or third page. Also, though it is at the bottom of the page, the headline is in ALL CAPS. While a specific author is credited, he clearly crafted the article using the AP wire service content (which is also credited). Perhaps that had an impact on placement.\n\nRegardless, thanks for the great find, and thanks for joining us in this research!\n\n/David",
