                "Contributor": "Krissy McCormack",
                "User Comments": "Printed on the fourth page are statements claimed by Rabbi Wise that Hitler is exterminating millions of Jews in Europe and is supported and confirmed by Roosevelt.  Exterminations camps are not listed as one of the methods used in the mass murders;  Killing methods are depicted in a few different ways, including doctors injecting air bubbles into veins: \"One Nazi physician can handle more than 100 men an hour by this method.\"  Another method of extermination listed:  \"battalions commanded by elite SS troops were reported to have dragged victims from their homes or seized them on the streets of Polish towns.  Elderly Jews and cripples were carted directly to cemeteries and shot.\"  This article also says Hitler is offering 50 reichsmarks for each corpse which is then processed into commodities like soap.  \n\nWhile I would expected a confirmation that 2,000,000 people have been murdered in an effort to eliminate a culture, such news is not on the front page of the paper.",
