                "Event": "Nazi Plan to Kill All Jews Confirmed",
                "Location of research": "Google Newspaper Archive (https://news.google.com/newspapers)",
                "Status": "Published",
                "Contributor": "DiAnna Martinez",
                "User Comments": "This articles concerns Dr Wise describing the Nazi plan to kill all European Jews by the end of 1942. It goes on to explain that he had documentation that proved that this was the plan and that approximately half of the estimated 4 million Jews in Nazi occupied Europe had already been killed and the Nazis planned to move the rest off to Poland in order to complete their goal. Wise went on to say that Nazi doctors were killing \u201cmore than 100 men an hour, per doctor.\u201d The article goes on to say that the Polish government in exile in London reported that Himmler had ordered the extermination of one-half of the Jewish population in Poland by the end of the year and that 250,00 had been killed through September. Article continues on page 3. Link to article: https://news.google.com/newspapers?nid=MNNNGtAgD4EC&dat=19421125&printsec=frontpage&hl=en",
