                "Event": "Nazi Plan to Kill All Jews Confirmed",
                "Location of research": "Newsbank (http://infoweb.newsbank.com/)",
                "Status": "Published",
                "Contributor": "David Saavedra",
                "User Comments": "The article reports information released by the Polish government in exile about Himmler's plan to exterminate half of Poland's Jewish population by the end of 1942. It presents information about the reduction in ID papers for Jews in the Warsaw ghetto as well as the methods of transporting Jews to the camps of Treblinka, Belzec, and Sobibor.\n\nThe title seems a bit misleading. It implies that the plan is to kill half of Poland's Jews. In reality the plan was to do that by the end of December 1942 and then continue with complete extermination.",
